// ViewTransactions.js (React component)

import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ViewTransactions = () => {
  const [transactions, setTransactions] = useState([]);

  useEffect(() => {
    fetchTransactions();
  }, []);

  const fetchTransactions = async () => {
    try {
      const response = await axios.get('/api/transactions'); // Update URL to point to port 5000
      setTransactions(response.data); // Update state with fetched transactions
    } catch (error) {
      console.error('Error fetching transactions:', error);
    }
  };

  return (
    <div>
      <h2>Transactions</h2>
      <ul>
        {transactions.map(transaction => (
          <li key={transaction.id}>
            Name: {transaction.description}, Amount: ${transaction.amount / 100}, Payment ID: {transaction.id}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ViewTransactions;
